import React from "react";

import "./MemberPage.scss";
import { useRecoilValueLoadable } from "recoil";
import { asyncGetMemberList } from "../lib/store/qna";
import { useNavigate } from "react-router-dom";

export type MemberPageProps = {
  cx?: string;
};

const useMember = () => {
  const { state, contents } = useRecoilValueLoadable(
    asyncGetMemberList({ page: 1 })
  );
  const returnVal = { 운트라: [], 디솔루티: [], 레크레아티: [], 옵세르보: [] };
  try {
    return {
      state,
      contents:
        state !== "hasValue"
          ? returnVal
          : contents.reduce(
              (
                a: typeof returnVal,
                c: { 이름: string; 계통: string; key_name: string }
              ) => {
                //@ts-ignore
                a[c.계통] = [...a[c.계통], { 이름: c.이름, key_name: c.key_name }];
                return a;
              },
              returnVal
            ),
    };
  } catch (e) {
    return { state: "hasError", contents: returnVal };
  }
};
